import { Table, TableContainer, Tbody, Td, Tfoot, Th, Thead, Tr } from "@chakra-ui/react";
import React from "react";
import { useEffect, useState } from "react";

const ArtistTable = () => {
	const [artists, setArtists] = useState<AnyObject>();

	const url =
		"https://sheets.googleapis.com/v4/spreadsheets/1ihTMg293oX-0F5ujBPRkN2rfCg9o1l1yLZWeBgW9rSw/values/Sheet1!A:H?majorDimension=COLUMNS&key=AIzaSyC8KA4Chg1gzz6mvhp-4pH5mE03b49Js5U";
	const fetchData = async (controller: AbortController) => {
		const resp = await fetch(url, {
			signal: controller.signal,
		});

		if (!resp.ok) throw new Error("Explotó");

		const respData = await resp.json();
		setArtists(respData);
	};

	useEffect(() => {
		let controller = new AbortController();

		fetchData(controller);

		return () => controller?.abort();
	}, []);

	let list = artists?.values[0].map((artist: string, index: number) => (
		<li key={index}>{artist}</li>
	));

	return (
		<TableContainer>
			<Table size="sm">
				<Thead>
					<Tr>
						<Th>Artist</Th>
						<Th>Album</Th>
						<Th>Genre</Th>
						<Th isNumeric>Year</Th>
						<Th>Language</Th>
						<Th>Location</Th>
						<Th isNumeric>Purchased</Th>
					</Tr>
				</Thead>
				<Tbody>
					<Tr>
						<Td>inches</Td>
						<Td>millimetres (mm)</Td>
						<Td isNumeric>25.4</Td>

					</Tr>
				</Tbody>
			</Table>
		</TableContainer>
	);
};

interface AnyObject {
	[key: string]: any;
}

export default ArtistTable;
